import {Component, EventEmitter, Output} from '@angular/core';
import {FormBuilder, FormGroup, ReactiveFormsModule, Validators} from "@angular/forms";
import {FlightService} from "../../services/flight/flight.service";
import {MatFormField, MatFormFieldModule, MatHint, MatLabel} from "@angular/material/form-field";
import {MatInput} from "@angular/material/input";
import {MatDatepicker, MatDatepickerInput, MatDatepickerToggle} from "@angular/material/datepicker";
import {MAT_DATE_LOCALE, MatNativeDateModule, provideNativeDateAdapter} from "@angular/material/core";
import {provideMomentDateAdapter} from "@angular/material-moment-adapter";
export const MY_FORMATS = {
  parse: {
    dateInput: 'LL',
  },
  display: {
    dateInput: 'DD-MM-YYYY',
    monthYearLabel: 'MMM YYYY',
    dateA11yLabel: 'LL',
    monthYearA11yLabel: 'MMMM YYYY',
  },
};
@Component({
  selector: 'app-browser-form',
  standalone: true,
  imports: [
    ReactiveFormsModule,
    MatLabel,
    MatFormField,
    MatInput,
    MatDatepicker,
    MatFormFieldModule,
    MatDatepickerInput,
    MatNativeDateModule,
    MatHint,
    MatDatepickerToggle
  ],
  providers:[
    provideNativeDateAdapter(),
    provideMomentDateAdapter(MY_FORMATS),
    { provide: MAT_DATE_LOCALE, useValue: 'en-GB' }

  ],
  templateUrl: './browser-form.component.html',
  styleUrls: ['./browser-form.component.scss']
})
export class BrowserFormComponent {
  @Output() flightsSender: EventEmitter<Array<any>> = new EventEmitter();
  @Output() locationsSender: EventEmitter<string[]> = new EventEmitter();
  availableFlights!:Array<any>;
  locations:string[] = [];
  flightForm!: FormGroup;

  constructor(private fb: FormBuilder,
              private fs: FlightService) {
    this.flightForm = this.fb.group({
      origin: ['', Validators.required],
      destination: ['', Validators.required],
      adults: [0, Validators.required],
      dateOfDeparture: [new Date(), Validators.required],
      dateOfReturn: ['', Validators.required],
    });
  }

  onSubmit(){
    const originValue = this.flightForm.get('origin')!.value;
    const destination = this.flightForm.get('destination')!.value;
    console.log(this.flightForm.value)
   if (originValue && destination){
     this.locations[0] = originValue;
     this.locations[1] = destination;
     this.locationsSender.emit(this.locations);
     this.fs.searchCodeForCity(originValue).subscribe((res: any)=>{
       this.flightForm.get('origin')?.setValue(res.data[0].address.cityCode)
       console.log(this.flightForm.get('origin')?.value);

       this.fs.searchCodeForCity(destination).subscribe((res: any)=>{
         this.flightForm.get('destination')?.setValue(res.data[0].address.cityCode)
         console.log(this.flightForm.get('destination')?.value);

         this.fs.showAvailableFlights(this.flightForm).subscribe((res: any)=>{
           this.availableFlights = res.data;
           console.log(res)
           console.log(this.availableFlights);
           this.flightsSender.emit(this.availableFlights);
         })
       });
     });
   }
  }

}
<div class="container">
    <h1>Flight Browser</h1>
    <form [formGroup]="flightForm" (submit)="onSubmit()">
      <mat-form-field class="example-full-width">
        <mat-label>Lotnisko wylotu</mat-label>
        <input matInput formControlName="origin" >
      </mat-form-field>
        <mat-form-field >
            <mat-label>Lotnisko przylotu</mat-label>
            <input matInput type="text" formControlName="destination">
        </mat-form-field>
        <mat-form-field>
            <mat-label>Data wylotu</mat-label>
          <input matInput [matDatepicker]="departurePicker" formControlName="dateOfDeparture">
          <mat-hint>MM/DD/YYYY</mat-hint>
          <mat-datepicker-toggle matIconSuffix [for]="departurePicker"></mat-datepicker-toggle>
          <mat-datepicker #departurePicker></mat-datepicker>
        </mat-form-field>
      <mat-form-field>
        <mat-label>Data Powrotu</mat-label>
        <input matInput [matDatepicker]="returnPicker" formControlName="dateOfReturn" >
        <mat-hint>MM/DD/YYYY</mat-hint>
        <mat-datepicker-toggle matIconSuffix [for]="returnPicker"></mat-datepicker-toggle>
        <mat-datepicker #returnPicker></mat-datepicker>
      </mat-form-field>
        <mat-form-field>
            <mat-label>Liczba pasażerów</mat-label>
            <input matInput type="number" formControlName="adults">
        </mat-form-field>
        <button type="submit">Search flight!</button>
    </form>
</div>
